import React, { Component } from "react";


import "../pages/Home.css";
import Search from '../component/Search';
import SearchBar from '../component/SearchBar';
import Dropdown from '../component/Dropdown';

let nameSpace = {};
fetch("http://localhost:8080/courses")
    .then(resp => { return resp.json() })
    .then(courseList => nameSpace.courses = courseList)

const courses = [
    { id: '12345', name: 'Course One' },
    { id: '22345', name: 'Course Two' },
    { id: '334536', name: 'Course Three' },
    { id: '42345', name: 'Course Four' },
];

function fetchData(ext, save) {
  fetch("http://localhost:8080/" + ext)
  .then(resp => { return resp.json()})
  .then(data => { save = data })
}

class Home extends Component {
  // Create a default state of this component
  constructor() {
    super();
    this.state = {};
    this.courses = [];
    this.fallCourses = [];
    this.springCourses = [];
    fetch("http://localhost:8080/courses")
      .then(resp => { return resp.json()})
      .then(data => { this.courses = data })
    fetch("http://localhost:8080/fall")
      .then(resp => { return resp.json()})
      .then(data => { this.fallCourses = data })
    fetch("http://localhost:8080/spring")
      .then(resp => { return resp.json()})
      .then(data => { this.springCourses = data })
  }
  render() {
    console.log(this.courses)
    return (
      <div className="Home">
        <h1 class = "pad">Scheduler Application </h1>
        <Dropdown/>
        <Search />
        <SearchBar />
          <ul>
            {this.state.courses.map(course => {
              <li>{course.title}</li>
            })}
          </ul>
      </div>
    );
  }
}

export default Home;
